(13543, 1, 1, 'Lamps are an indispensable part of the home decor. Every lamp looks differently and consists of different shapes, materials and colours. Therefore, House Doctor enables you to choose the look you want with this superfine socket, Fly, which has a black colour. Choose a light bulb that gives the light you want in the room and decide if you want to add a beautiful lamp shade ﾖ perhaps a lamp shade that will provide the home decor with a sculptural element. Note: Light bulb is not included. Buy a E27, Max 40 W light bulb separately.<br /><br /><br /> Opis<br /><br />Materiał<br />    Fabric/Iron/<br />Wymiary<br />    L10cm. średnica4.5cm<br />Kolor<br />    Czarny<br />', 'Wysyłamy w 2-14 dni', 'socket-fly-black', '', '', '', 'Socket, Fly, Black', '', '', NULL, NULL),
(13705, 1, 1, 'Lighting is an important part of every room. It brings life and atmosphere to the interior in a decorative way but it also functions as a practical element that makes it easier to navigate in your home whether if its daytime or nighttime. This light bulb from House Doctor is therefore a necessity in your home. The LED-bulb, G9, 2 W, is perfect for a wide range of lamps. No matter in what room you use the light bulb, it will light up the room in the most beautiful way.<br /><br /><br /> Opis<br /><br />Materiał<br />    Glass<br />Wymiary<br />    L5cm. Lifetime 2000 Hours<br />Kolor<br />    Przezroczysty<br />', 'Wysyłamy w 2-14 dni', 'led-bulb-g9', '', '', '', 'LED bulb, G9', '', '', NULL, NULL),
